import styles from "./styles.module.css";

const Main = () => {
  const handleLogout = () => {
    localStorage.removeItem("token");
    window.location.reload();
  };

  // Assuming you have access to the user's name and password from somewhere
  const userName = "John Doe";
  const userPassword = "********"; // Assuming you want to hide the password

  return (
    <div className={styles.main_container}>
      <nav className={styles.navbar}>
        <h1>fakebook</h1>
        <div className={styles.user_info}>
          <p className={styles.user_name}>Name: {userName}</p>
          <p className={styles.user_password}>Password: {userPassword}</p>
        </div>
        <button className={styles.white_btn} onClick={handleLogout}>
          Logout
        </button>
      </nav>
    </div>
  );
};

export default Main;
